import React from 'react';
import whaleImage from '../images/whale.png'; // 你需要将小鲸鱼图片保存为whale.png

const WhaleIcon = ({ size = 24, className = '' }) => {
  return (
    <img 
      src={whaleImage} 
      alt="小鲸鱼" 
      width={size} 
      height={size} 
      className={className}
      style={{ 
        display: 'inline-block',
        verticalAlign: 'middle'
      }}
    />
  );
};

export default WhaleIcon;
